-- Table structure for table `sv_m_form_template`
--

DROP TABLE IF EXISTS `sv_m_form_template`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `sv_m_form_template` (
  `id` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL,
  `code` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT 'Form Template Code',
  `revision` smallint NOT NULL,
  `template_group_id` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT 'ref to sv_m_form_template_group.id',
  `hierachy_level` smallint NOT NULL,
  `lineage_templates` json DEFAULT NULL COMMENT 'สายตระกูลของ template (ว่าสืบทอดมาจาก template ใด) format = [{"templateId": "t-1", "hierachyLevel": 1}, {"templateId": "t-2", "hierachyLevel": 2}]',
  `root_template_id` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT 'ref to sv_m_form_template.id (root ของ template กรณีมีการแก้ไข template)',
  `parent_template_id` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT 'ref to sv_m_form_template.id (parent ของ template กรณีมีการแก้ไข template)',
  `name` varchar(150) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT 'Form Template Name',
  `description` varchar(250) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT 'Form Template Description',
  `remark` varchar(250) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL,
